import ReactDOM from 'react-dom'

export default function MusicNote(props){

	this.state = {
		draggedElement: null
	}

	return(
		<div>
			<img src = {process.env.PUBLIC_URL + 'music-note.png'} draggable = "true" onDrag = {(e) => {
					console.log(e)
					this.setState({draggedElement:e})
			}}/>
		</div>
		)
}
